import React, { Component } from 'react';
import styled from 'styled-components';

interface ContainerProps {
  children: Component;
}

const Wrapper = styled.div`
  margin: 8px;
  display: flex;
  justify-content: space-evenly;
`;

export default function Container(props: ContainerProps) {
  return (
    <Wrapper>
      {props.children}
    </Wrapper>
  )
}
